import React, { Component } from 'react'
import BlaBla from '../../../Components/BlaBLa/BlaBla'
import ButtonProject from '../../../Components/ButtonProject/ButtonProject';
import Polygons from '../../../Components/Polygons/Polygons';

class SectionOne extends Component {
  state = {
    blabla:
    {
      id: 1, title: 'DEVELOPPEUR FRONT-END', subtitle: 'React.js, Freelance', text: "Grâce à mon expérience professionnelle, j'ai pu suivre de multiples cours sur les languages suivants : HTML, CSS. Et ainsi étendre mes compétences digitale. Certifié du Wagon après un bootcamp de deux mois, où j'ai pu compléter mes compétences par un language supplémentaire, Javascript. Language à l'aide duquel j'ai décidé de me spécialisé dans le front-end grâce au framework, React.js. Formation à la suite de laquelle j'ai décidé me spécialiser en tant que développeur web Full-Stack. Également inscrit à l'Ecole 42 pour 2020."
    },
    inputs: [
      { alt: 'HTML5', img: 'https://upload.wikimedia.org/wikipedia/commons/6/61/HTML5_logo_and_wordmark.svg' },
      { alt: 'Javascript', img: 'https://icn.lycee-valin.fr/projets2018/seconde14/eleve12/images/javascript.png' },
      { alt: 'CSS3', img: 'https://upload.wikimedia.org/wikipedia/commons/d/d5/CSS3_logo_and_wordmark.svg' }
    ],
    btnText: "Découvrez mes projets"
  }

  render() {
    return (
      <div id="section-one" className="section-one">
        <a href="/" id="Marketeur-Digital" className="section-anchor"> </a>
        <div className="section-wrapper">
          <div className="section-left col-xs-12 col-sm-6 col-md-6">
            <BlaBla blabla={this.state.blabla} />
            <ButtonProject text={this.state.btnText} />
          </div>
          <div className="section-right d-none d-sm-block col-sm-6 col-md-6 align-center">
            <div className="section-wrapper-right">
              <Polygons inputs={this.state.inputs} />
            </div>
          </div>
        </div>
      </div>
    )


  }
}

export default SectionOne;
